import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card';
//import registerServiceWorker from './registerServiceWorker';
import 'tachyons';
import {robots} from './robots';


ReactDOM.render(<div>
			<Card id={robots[0].id} name={robots[0].name} username={robot[0].username} email={robots[0].email}/>
			<Card id={robots[1].id} name={robots[1].name} username={robot[1].username} email={robots[1].email}/>
			<Card id={robots[2].id}name={robots[2].name} username={robot[2].username} email={robots[2].email}/>
			<Card id={robots[3].id} name={robots[3].name} username={robot[3].username} email={robots[3].email}/>
			<Card id={robots[4].id}name={robots[4].name} username={robot[4].username} email={robots[4].email}/>
			<Card id={robots[5].id} name={robots[5].name} username={robot[5].username} email={robots[5].email}/>

				</div>
	,
	document.getElementById('root'));




